//Desectructuración de arrays
const personajes = ['Goku','Vegeta','Trunks'];

//Primer elemento
const [ p1 ] = personajes;
//Tercer elemento
const [,,p3] = personajes;

console.log(p1);
console.log(p3);

const retornaArreglo = () => {
    return ['ABD', 123];
}
